short_description:
Ces artichauts sont cueillis, pelés et préparés à la main, puis simplement blanchis à l’eau salée et laissés à mariner dans de l’huile d’olive extra vierge, Persil, Ail Sel et Vinaigre.
Ils ont une saveur douce et une texture croquante.
Idéal pour vos garnitures Pizza, Salade, pâtes, riz, quiches&#8230;

L’harissa est préparée avec des piments de Cayenne séchés au soleil, huile d’olive vierge extra, Ail, Carvi, Coriandre et Sel.
Avec son petit goût de fumée, ce condiment typiquement tunisien se démarque.
Idéale pour vos Pizza, Pâtes, Soupes, Sauces, Ragouts, Omelettes, Tartines, Sandwich&#8230;
